import { Carros } from '../carros';
import { Component, OnInit } from '@angular/core';
import { CarrosService } from '../carros.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-create-carros',
  templateUrl: './create-carros.component.html',
  styleUrls: ['./create-carros.component.css']
})
export class CreateCarrosComponent implements OnInit {

 carro: Carros = new Carros();

  constructor (private carroService: CarrosService,
    private router: Router) { }


  ngOnInit(): void { }

    saveCarro() {
      this.carroService.createCarros(this.carro).subscribe(data =>{

      })
      this.router.navigate(['/carros-list'])
    }

    cancel(): void {
      this.router.navigate(['/carros-list']);
    }

    onSubmit(){
      console.log(this.carro);
      this.saveCarro();
    }
}
   <div class="col-md-6 offset-md-3">

    <h3 class="cor"> Cadastrar Usúarios </h3>
    <form (ngSubmit) = "onSubmit()" #carroForm="ngForm">


        <div class="form-group">
            <label class="cor"> Marca: </label>
            <input type="text" class ="form-control" id = "marca"
                [(ngModel)] = "carro.marca" name = "marca">
        </div>
        <div> </div>
        <div class="form-group">
            <label class="cor"> Modelo: </label>
            <input type="text" class ="form-control" id = "modelo"
                [(ngModel)] = "carro.modelo" name = "modelo">
        </div>
        <div> </div>
        <div class="form-group">
            <label class="cor">  Ano de Fabricação: </label>
            <input type="number" class ="form-control" id = "anoFabricacao"
                [(ngModel)] = "carro.anoFabricacao" name = "anoFabricacao">
        </div>
        <div> </div>
        <div class="form-group">
            <label class="cor"> Ano do Modelo: </label>
            <input type="number" class ="form-control" id = "anoModelo"
                [(ngModel)] = "carro.anoModelo" name = "anoModelo">
        </div>
        <div> </div>
        <div class="form-group">
            <label class="cor"> Valor: </label>
            <input type="text" class ="form-control" id = "valor"
                [(ngModel)] = "carro.valor"  name = "valor">
        </div>
        <div> </div>
        <div class="form-group">
            <label class="cor"> Descrição: </label>
            <input type="text" class ="form-control" id = "descricao"
                [(ngModel)] = "carro.descricao" name = "descricao">
        </div>
        <div> </div>

        <div *ngIf="carroForm.submitted && carroForm.invalid" class="alert alert-danger">
            Por favor, preencha todos os campos obrigatórios.
         </div>
        <button class = "btn btn-success" [disabled]="carroForm.invalid" (click)="saveCarro()"  >Cadastrar Carro</button>



    </form>
    </div>
